            var month = athdate.slice(5, 7)
            var year = athdate.slice(0, 4)
            athdate = day + "-" + montharray[month - 1] + "-" + year;
            ath = responsedata[m].ath;
            if (ath > 1000000) {
              ath = "$" + parseFloat(ath / 100000).toFixed(3) + "M";

            } if (price > 100000) {
              price = "$" + price / 1000000 + "M";
            }
            else {
              ath = "$ " + ath;
              price = "$ " + price;
            }
            if (vol >= 1000000 && vol < 1000000000) {
              vol = (vol / 1000000)
              vol = parseFloat(vol).toFixed(2)
              vol = "$ " + vol + " M"
            }
            else if (vol >= 1000000000) {
              vol = (vol / 1000000000)
              vol = parseFloat(vol).toFixed(2)
              vol = "$ " + vol + " B"
            }
            if (vol <= 1000000) {

              vol = parseFloat(vol).toFixed(2)
              vol = "$ " + vol
            }

            athParcentage = responsedata[m].ath_change_percentage;
            athParcentage = parseFloat(athParcentage).toFixed(2) + "%";

            if (m > 50) {
              load()
            }
            row = `<tr class="${smallClass}"> <td class="rank"  style="padding:1px; width:50px; font-size: smaller;">${coinrank}</td><td class="NAME"><img title=${Name} src=${responsedata[m].image} style="width:30px">&nbsp;<br>  ${symbol}</td><td class="${smallClass}"  >${price}</td><td class="${smallClass}" ><av style="font-size:${ChangeFont}" class=${changecolor}>${change}</av></td><td class="${smallClass}" data-title="Volume (Buy + Sell ) ">${vol}</td><td class="${smallClass}"  >&nbsp;${ath}</td><td class="${smallClass}" data-title=" Down From ATH " class="ATH ${smallClass}">${athParcentage}</td><td class="${smallClass}"  >${athdate}</td></tr>`;
            TableBody.innerHTML += row;
          }
          marketsetuation = marketsetuation / 250;
          console.log("Market Setuationn======", marketsetuation)
          document.getElementById("gain").value = gain + "▲";
          document.getElementById("loss").value = loss + "▼";
        });
    }
    // document.getElementById("feargreed").innerHTML+=marketsetuation
    // onload(document.write("loading........."))
    ChangeBase();

  </script>
